"\nimport asyncio\nfrom playwright.async_api import async_playwright\n\n\nasync def run():\n    async with async_playwright() as p:\n        browser = await p.chromium.launch(headless=False)\n        page = await browser.new_page()\n\n\n await page.goto(\"https://www.google.com/\")\n await page.fill(\"[name=q]\", \"search query\")\n await page.wait_for_selector(\"div.suggestions\")\n await page.click(\"[name=btnK]\")\n await page.wait_for_selector(\"#search\")\n await page.click(\"[href*='accounts.google.com/signin']\")\n await page.fill(\"[type=email]\", \"email@example.com\")\n await page.click(\"#identifierNext\")\n await page.fill(\"[type=password]\", \"password\")\n await page.click(\"#passwordNext\")\n await page.click(\"a[href*='images']\")\n await page.fill(\"[name=q]\", \"image search\")\n await page.wait_for_selector(\"#islmp\")\n await page.click(\"a.gb_d\")\n await page.wait_for_selector(\"div[aria-label='Google apps']\")\n await page.click(\".gb_j\")\n await page.click(\"button.g3VIld\")\n await page.click(\"a[href*='preferences']\")\n await page.wait_for_selector(\"#setting-form\")\n await page.click(\"input[type=radio]\")\n await page.click(\"input[type=submit]\")\n\n        await browser.close()\n\n\nasyncio.run(run())\n"